import MovieCard from "../../components/MovieCard";
import Pagination from "../../components/Pagination";

function Listing(){
    return (
        <>
        <Pagination/>
        <div className="container" >
            <div className="row" >
                <div className="col-md-6" >
                    <MovieCard/>
                </div>
            </div>
        </div>
        </>
    );
}

export default Listing;
